  \"Net Shape Molding of Monolithic Complex-shaped Damage-Tolerant Cryo-Insulators
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-07T01:25:29.376323\",\n\t\"name\":
  \"net-shape-molding-of-monolithic-complex-shaped-damage-tolerant-cryo-insulators-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Passive thermal control of cryogenic systems
  using foam insulations can help achieve Zero Boil-Off (ZBO). There is as much thermal
  energy transferred to Cryo tanks during the ascent phase as there is during 6 days
  of orbital operations using MLIs.rnrnSpray on Foam Insulation (SOFI) still suffers
  from drawbacks both at chemistry and interfacial (bonding) levels. Currently, strong
  lightweight polymeric foam insulators cannot be (net shape) molded into larger complex
  shapes, using commercial foaming practices. The proposed Phase 1 research studies
  feasibility of an inventive (unprecedented) combination of processing and \"green\"
  foaming agents to \"net-shape\" mold low density robust (damage/MMOD tolerant) polymeric
  insulation foams into \"monolithic\" complex shapes (such as spherical or cylindrical
  shells, valve fittings). These can protect polymer matrix composite (PMC) tanks
  (such as COPVs) against external damages, hence enabling reliable, reusable cryogenic
  storage designs.rnrnAn added advantage of this invention is the \"clean\" decomposition
  of the blowing agent and development of an environmentally \"green\" insulative
  \"net-shape\" foaming technology.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
